import React, {Component} from "react";

class BannerApp extends Component{
    render(){
        return (
			<div class="hero">
				<div class="container">
					<form action="#" class="find-location">
						<input type="text" placeholder="Find your location..." />
						<input type="submit" value="Find" />
					</form>
				</div>
			</div>
        );
    }
}

export default BannerApp;
